import './App.css';
import Home from './views/Home/Home';
import Landing from './views/Landing/Landing';
import { Route } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Route exact path='/' componente={Landing} />

      <Route path='/home' />
    </div>
  );
}

export default App;
